(75, 'en', '*', 'admin', 'email.help_modal_title', 'Help', 0, 0, '2017-02-21 15:52:08', '2017-02-21 15:52:08'),
(76, 'en', '*', 'admin', 'email.help_modal_body', '<p>Email templates are useful to send content by email to users. Better design will help to have a better response from the user. We’ll have to keep into \r\n                    account different aspects.</p>\r\n                    <p>Source code of email templates are found in carpeta /resources/views/emails. This code can be edited using this page or uplading new files directly \r\n                    to that folder.</p>\r\n                    <p>Template images are found in /public/images/email_templates. In case It’s needed new images, they can be uploaded to this folder, and \r\n                    then be referenced in the templates.</p>\r\n                    <br>\r\n                    <h4>Base template</h4>\r\n                    <p>Base template defines the structure and styles that contains all templates of email. When a child template takes the content of the mother template, it means that \r\n                    the body of the template child is copied directly from the body of the mother template. It is mandatory that both child templates and mother templates contain the \r\n                    following requirements:\r\n                        <ol>\r\n                            <li>Mother template must contain code @yield (\'template_content\') in the area where wants to have pasted the code of the child templates.</li>\r\n                            <li>&lt;Table&gt; element is used to mount structure of the template.</li>\r\n                            <li><b>Inline stiles, as not all clients identify well content from classes.  As example, a &lt;table&gt; with red color is written as:</b> \r\n                            &lt;table style=\"background-color: red\"&gt;&lt;/table&gt; </li>\r\n                        </ol>\r\n                    </p>\r\n                    <h4>Child templates</h4>\r\n                    <p>Child templates contain the structure from the mother template, as it inserts the body of the template child in the plate where the code is \r\n                    defined as <b>&commat;yield(\'template_content\')</b>. As example:\r\n                    \r\n                    <b>Base template:</b><br>\r\n                    <code>\r\n                        &lt;html&gt;<br>\r\n                        &nbsp;&nbsp;&nbsp;&lt;body&gt;<br>\r\n                       &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&commat;yield(\'template_content\')<br>\r\n                        &nbsp;&nbsp;&nbsp;&lt;/body&gt;<br>\r\n                        &lt;/html&gt;<br>\r\n                    </code>\r\n                    <b>Child template:</b><br>\r\n                    <code>\r\n                        &commat;extends(\'emails/master\')<br>\r\n                        &commat;section(\'emails/master\')<br>\r\n                        &nbsp;&nbsp;Hola Mundo!!!<br>\r\n                        &commat;endsection(\'emails/master\')<br>\r\n                    </code>\r\n                    <b>Will have the following response:</b><br>\r\n                    <code>\r\n                        &lt;html&gt;<br>\r\n                        &nbsp;&nbsp;&nbsp;&lt;body&gt;<br>\r\n                        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Hola Mundo!!!<br>\r\n                        &nbsp;&nbsp;&nbsp;&lt;/body&gt;<br>\r\n                        &lt;/html&gt;<br>\r\n                    </code>\r\n                    <br>\r\n                    Please be aware the following elements when editing the child template:\r\n                    <ol>\r\n                        <li>The child template must contain only one element  &commat;extends(\'emails/master\') located at the beginning.</li>\r\n                        <li>Child template must contain a block &commat;section (\'template_content\')...&commat;endsection(\'template_content\') that contains the content of the child template.</li>\r\n                    </ol>\r\n                    <h4>Variables</h4>\r\n                        Each template contains a few variables with data of the element that is loading.<br> \r\n                        <ol>\r\n                            <li>To print one variable, we use the format &lbrace;&lbrace; nombre_variable &rbrace;&rbrace;</li>\r\n                        </ol>', 0, 0, '2017-02-21 15:52:08', '2017-02-21 15:52:08'),
