(10863, 'US-es', '*', 'admin', 'email.help_modal_body', '<p>Las plantillas de correo electrónico sirven para enviar contenido mediante el correo a los usuarios,\nmientras mejor diseñada estén las plantillas más bonito y funcional será el email que recibirá el usuario.\nPara ello hay que tener en cuenta varios asuntos.</p>\n<p>El código fuente de las plantillas de email se encuentra en la carpeta /resources/views/emails este código se puede editar usando esta\npágina o subiendo archivos directamente a esa carpeta mediante el uso de un cliente FTP</p>\n<p>Las imágenes usadas en las plantillas de email se encuentran en la carpeta /public/images/email_templates,\nen caso de que se quieran utilizar imágenes nuevas estas pueden ser subidas a esta carpeta y luego referenciadas en las plantillas</p>\n<br>\n<h4>Plantilla base</h4>\n<p>La plantilla base define la estructura y los estilos que contienen todas las plantillas de email que heredan de esta.\nCuando una plantilla hija hereda de una plantilla padre esto significa que el cuerpo de la plantilla hija es copiado\ndirectamente dentro del cuerpo de la plantilla padre. Es preciso que tanto las plantillas hijas como la plantilla base cumplan los siguientes requisitos.\n<ol>\n<li>La plantilla padre debe contener el código <b>&commat;yield(\'template_content\')</b> en el área donde se desee que se pegue el\ncontenido de las plantillas hijas, esto es muy importante dado que la ausencia del mencionado código provocaría que no se produjera herencia entre las plantillas</li>\n<li>Usar el elemento <b>table</b> para armar la estructura de la plantilla, dado que se consigue así que los emails se vean iguales\nsin importar la plataforma o el cliente de correo utilizado</li>\n<li>Usar estilos inline, dado que no todos los clientes identifican correctamente los estilos mediante el uso de clases y tal. Un estilo inline se define dentro\nde la etiqueta, por ejemplo, si queremos que una etiqueta &lt;table&gt; tenga un color de fondo rojo procederíamos así: &lt;table style=\"background-color: red\"&gt;&lt;/table&gt; </li>\n</ol>\n</p>\n<h4>Plantillas hija</h4>\n<p>Las plantillas hija, heredan la estructura y los estilos de la plantilla padre mediante la inserción del cuerpo de la plantilla hija en el lugar donde está definido el código <b>&commat;yield(\'template_content\')</b>.\nEsto se produce mediante la definición de la sección que se desea vaya dentro de la plantilla padre, a continuación se muestra un ejemplo:</p>\n<b>Plantilla base:</b><br>\n<code>\n&lt;html&gt;<br>\n&nbsp;&nbsp;&nbsp;&lt;body&gt;<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&commat;yield(\'template_content\')<br>\n&nbsp;&nbsp;&nbsp;&lt;/body&gt;<br>\n&lt;/html&gt;<br>\n</code>\n<b>Plantilla hija:</b><br>\n<code>\n&commat;extends(\'emails/master\')<br>\n&commat;section(\'emails/master\')<br>\n&nbsp;&nbsp;Hola Mundo!!!<br>\n&commat;endsection(\'emails/master\')<br>\n</code>\n<b>Produciría como resultado la siguiente respuesta</b><br>\n<code>\n&lt;html&gt;<br>\n&nbsp;&nbsp;&nbsp;&lt;body&gt;<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Hola Mundo!!!<br>\n&nbsp;&nbsp;&nbsp;&lt;/body&gt;<br>\n&lt;/html&gt;<br>\n</code>\n<br>\nTenga en cuenta los siguientes elementos al editar plantillas hija.\n<ol>\n<li>La plantilla hija debe tener solo un elemento &commat;extends(\'emails/master\') ubicado al inicio de la misma</li>\n<li>La plantilla hija debe tener un bloque &commat;section(\'template_content\')...&commat;endsection(\'template_content\') con el contenido de la plantilla hija dentro de este bloque</li>\n</ol>\n<h4>Variables</h4>\nCada plantilla va a tener asociadas algunas variables con datos referentes a la función de la plantilla en cuestión.<br>\n<ol>\n<li>Para imprimir una variable se utiliza el formato &lbrace;&lbrace; nombre_variable &rbrace;&rbrace;</li>\n</ol>', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
